import "./App.scss";

function App() {
  return (
    <div className="App">
      <header>
        <h1>Portfolio Site</h1>
        <h4>This is my portfolio site</h4>
      </header>
      <nav>
        <a >home</a>
        <a >project 1</a>
      </nav>
      <main>
        <p>This is project 1</p>
        <p>This is project 2</p>
        <p>This is project 3</p>
      </main>
      <footer>Footer</footer>
    </div>
  );
}

export default App;
